    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["pop18"];
    let aliases = ["Population"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>

        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
